                        ["do_custom"] = false,
                        ["custom"] = "aura_env.marklist = {\
          [\"star\"] = 1,\
          [\"circle\"] = 2,\
          [\"diamond\"] = 3,\
          [\"triangle\"] = 4,\
          [\"moon\"] = 5,\
          [\"square\"] = 6,\
          [\"cross\"] = 7,\
          [\"skull\"] = 8,\
      }\
